DEBUG - 2014-03-17 09:59:22 --> INSERT INTO `quku_songs_lrcs` (`sl_globalid`, `sl_song_id`, `sl_lrclink`, `sl_lyrics`, `sl_jointime`, `sl_usage_flag`) VALUES ('98194961', '98194963', 'http://bcs-sandbox.baidu.com/qukuauto/data2/lrc/98194961/98194961.lrc', '\n[00:02.58]月到天心处\n[00:04.51]作词：姚谦 作曲：Fingazz\n[00:07.76]演唱：吉克隽逸\n[00:09.82]\n[00:21.96]到天涯 攀一朵蔷薇\n[00:29.63]曾少年 以为 最美好的世界应该在\n[00:40.13]远方\n[00:42.60]多少辛酸不计\n[00:46.94]只为看见繁华\n[00:52.48]\n[00:52.83]翻过山 越过海\n[00:56.34]以为他乡终可以 当做故乡\n[01:00.74]却遗忘 心中呼唤\n[01:04.79]月到天心处风到水面时\n[01:09.20]喔……\n[01:26.18]\n[01:46.89]我 假装 是同一个月亮\n[01:55.45]从山顶 也迁移到摩天楼窗台上\n[02:05.77]一样圆缺\n[02:08.14]却有不同感伤\n[02:12.05]照着手中的蔷薇\n[02:17.77]翻过山 越过海\n[02:21.63]以为他乡终可以 当做故乡\n[02:26.09]却遗忘 心中呼唤\n[02:30.09]月到天心处风到水面时\n[02:34.19]喔……\n[02:51.71]\n[02:52.69]远方的蔷薇捧满怀\n[02:56.70]我依旧是那个小孩\n[03:00.80]就算站在世界顶端\n[03:05.82]我 只眺望 那个 方向\n[03:15.57]\n[03:17.63]翻过山 越过海\n[03:21.29]他乡最后怎可能 当做故乡\n[03:26.00]怎能忘 心中呼唤\n[03:29.93]月到天心处风到水面时\n[03:33.96]喔……\n[03:40.51]怎可能当做故乡\n[03:43.35]喔……\n[03:54.11]\n', '1394784112', '2')
